import './containerData.css'

function ContainerData({data}){


    return(

        <div className='containerData'>

            <div className='date'>

                <span>Ola</span>

            </div>

            <div className='date'>

                <span>Temperatura</span>
                {data.name}
              

            </div>

            <div className='date'>

                <span>Ola</span>

            </div>

            
          

        </div>

    );

}

export default ContainerData;
